package com.shubhendu.javaworld;

import java.util.Collections;
import java.util.Comparator;
import java.util.HashMap;
import java.util.Map;
import java.util.Map.Entry;
import java.util.PriorityQueue;

public class CharactersFrequencySorter {

	public String frequencySort(String s) {
		if (s == null) {
			return null;
		}
		StringBuilder sb = new StringBuilder();
		if (s != null) {
			Map<Character, Integer> charMap = new HashMap<Character, Integer>();
			for (char c : s.toCharArray()) {
				if (charMap.get(c) == null) {
					charMap.put(c, 1);
				} else {
					int count = charMap.get(c);
					charMap.put(c, ++count);
				}

			}
			Comparator<Item> itemComparator = new ItemComparator();
			PriorityQueue<Item> charFrequencyQueue = new PriorityQueue<Item>(itemComparator);
			for (Entry<Character, Integer> entry : charMap.entrySet()) {
				charFrequencyQueue.add(new Item(entry.getValue(), entry.getKey()));
			}
			
			Item item = null;
			while ((item = charFrequencyQueue.poll()) != null) {
				int frequency = item.getFrequency();
				String letter = item.getCharacter().toString();
				sb.append(String.join("", Collections.nCopies(frequency, letter)));
			}
		}
		return sb.toString();
	}

	public static void main(String[] args) {
		CharactersFrequencySorter charFrequencySorter = new CharactersFrequencySorter();
		String str = null;
		// System.out.println(charFrequencySorter.frequencySort(str));
		// str = "";
		System.out.println(charFrequencySorter.frequencySort(str));
		str = "AaabaacccddddddeeAafebeeeeeezb";
		 System.out.println(charFrequencySorter.frequencySort(str));
		// str = "aabaaccccddddddeefzz";
		// System.out.println(charFrequencySorter.frequencySort(str));
		// str = "Aaaabb";
		// System.out.println(charFrequencySorter.frequencySort(str));
		long startTime = System.currentTimeMillis();
		 str =
		 "";
		String sortedStr = charFrequencySorter.frequencySort(str);
		
		System.out.println(sortedStr);

	}

	class Item {
		Integer frequency;
		Character character;

		public Item() {

		}

		public Item(int frequency, char c) {
			this.frequency = frequency;
			this.character = c;
		}

		public Integer getFrequency() {
			return frequency;
		}

		public void setFrequency(Integer frequency) {
			this.frequency = frequency;
		}

		public Character getCharacter() {
			return character;
		}

		public void setCharacter(Character character) {
			this.character = character;
		}

	}

	class ItemComparator implements Comparator<Item> {
		public int compare(Item i1, Item i2) {
			return i2.getFrequency().compareTo(i1.getFrequency());
		}
	}

}
